import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { Github, ExternalLink, Code, Globe, Smartphone, Brain } from 'lucide-react';

const Projects = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  const projects = [
    {
      title: "Mind Controlled AI Wheelchair",
      description: "Converted EEG brain signals into real-time wheelchair commands with 95% directional accuracy by integrating pylsl, boosting mobility for users with motor impairments. Minimized noise in live EEG streams by 60% using a custom signal processing pipeline with buffering, notch filtering, and multi-band decomposition (alpha, beta, theta, delta). Accelerated control feedback loop by 35% through a containerized Pythonâ€“React pipeline using Flask, PostgreSQL, and Docker, enabling responsive mental-state-driven navigation.",
      image: "/img/port1.jpg",
      technologies: ["Python", "Flask", "React", "PostgreSQL", "Docker", "EEG", "pylsl", "Signal Processing"],
      github: "https://github.com/KrishD22/NeuroWheelchair",
      demo: null,
      category: "AI/ML"
    },
    {
      title: "Portfolio Website",
      description: "A modern, responsive portfolio website built with React, Framer Motion, and Tailwind CSS. Features animated particles, smooth transitions, and a custom cursor.",
      image: "/img/port2.jpg",
      technologies: ["React", "Framer Motion", "Tailwind CSS", "JavaScript"],
      github: "https://github.com",
      demo: "https://demo.com",
      category: "Web Development"
    },
    {
      title: "Rocketry Control System",
      description: "Developed an Arduino-based control system for air pressure rockets with IMU sensors, gyroscope integration, and Bluetooth communication modules.",
      image: "/img/port3.jpg",
      technologies: ["Arduino", "C++", "IMU", "Bluetooth", "Hardware"],
      github: "https://github.com",
      demo: null,
      category: "Hardware/IoT"
    },
    {
      title: "Hackathon Management Platform",
      description: "Created a comprehensive event management system for SPARK hackathon with scheduling, budgeting, and sponsor management features.",
      image: "/img/port4.jpg",
      technologies: ["Node.js", "React", "MongoDB", "Express"],
      github: "https://github.com",
      demo: "https://demo.com",
      category: "Full Stack"
    },
    {
      title: "Mobile Learning App",
      description: "A cross-platform mobile application designed to help students learn programming concepts through interactive tutorials and challenges.",
      image: "/img/port5.jpg",
      technologies: ["React Native", "JavaScript", "Firebase", "Redux"],
      github: "https://github.com",
      demo: "https://demo.com",
      category: "Mobile Development"
    },
    {
      title: "AI Text Analysis Tool",
      description: "Built a machine learning application that analyzes and processes text data using natural language processing techniques.",
      image: "/img/port6.jpg",
      technologies: ["Python", "TensorFlow", "NLP", "Flask"],
      github: "https://github.com",
      demo: "https://demo.com",
      category: "AI/ML"
    }
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2,
      },
    },
  };

  const itemVariants = {
    hidden: { y: 50, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: {
        duration: 0.6,
        ease: "easeOut",
      },
    },
  };

  const getCategoryIcon = (category) => {
    switch (category) {
      case "Web Development":
        return Globe;
      case "Mobile Development":
        return Smartphone;
      case "Hardware/IoT":
        return Code;
      case "AI/ML":
        return Brain;
      default:
        return Code;
    }
  };

  return (
    <section id="projects" className="section-padding relative">
      <div className="container-custom">
        <motion.div
          ref={ref}
          variants={containerVariants}
          initial="hidden"
          animate={inView ? "visible" : "hidden"}
        >
          <motion.h2 variants={itemVariants} className="text-4xl md:text-5xl font-bold text-center mb-16">
            Featured <span className="gradient-text">Projects</span>
          </motion.h2>

          <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8">
            {projects.map((project, index) => {
              const CategoryIcon = getCategoryIcon(project.category);
              
              return (
                <motion.div
                  key={index}
                  variants={itemVariants}
                  whileHover={{ 
                    scale: 1.02, 
                    y: -10,
                    transition: { duration: 0.3 }
                  }}
                  className="group relative glass-effect rounded-xl overflow-hidden"
                >
                  {/* Project Image */}
                  <div className="relative h-48 overflow-hidden">
                    <div className="absolute inset-0 bg-gradient-to-br from-accent-500/20 to-primary-500/20 z-10"></div>
                    <div className="absolute inset-0 bg-dark-900/50 z-20 flex items-center justify-center">
                      <CategoryIcon size={48} className="text-accent-500" />
                    </div>
                  </div>

                  {/* Project Content */}
                  <div className="p-6">
                    <div className="flex items-center justify-between mb-3">
                      <span className="text-xs text-accent-500 font-mono">{project.category}</span>
                      <div className="flex space-x-2">
                        {project.github && (
                          <motion.a
                            href={project.github}
                            target="_blank"
                            rel="noopener noreferrer"
                            whileHover={{ scale: 1.1 }}
                            whileTap={{ scale: 0.9 }}
                            className="p-2 bg-dark-700 hover:bg-accent-500 rounded-full transition-colors duration-200"
                          >
                            <Github size={16} />
                          </motion.a>
                        )}
                        {project.demo && (
                          <motion.a
                            href={project.demo}
                            target="_blank"
                            rel="noopener noreferrer"
                            whileHover={{ scale: 1.1 }}
                            whileTap={{ scale: 0.9 }}
                            className="p-2 bg-dark-700 hover:bg-accent-500 rounded-full transition-colors duration-200"
                          >
                            <ExternalLink size={16} />
                          </motion.a>
                        )}
                      </div>
                    </div>

                    <h3 className="text-xl font-bold mb-3 group-hover:text-accent-500 transition-colors duration-200">
                      {project.title}
                    </h3>

                    <p className="text-dark-300 text-sm leading-relaxed mb-4">
                      {project.description}
                    </p>

                    <div className="flex flex-wrap gap-2">
                      {project.technologies.map((tech, idx) => (
                        <span
                          key={idx}
                          className="px-2 py-1 bg-accent-500/10 text-accent-500 text-xs rounded-full border border-accent-500/20"
                        >
                          {tech}
                        </span>
                      ))}
                    </div>
                  </div>

                  {/* Hover Overlay */}
                  <div className="absolute inset-0 bg-gradient-to-t from-accent-500/20 to-transparent opacity-0 group-hover:opacity-100 transition-opacity duration-300"></div>
                </motion.div>
              );
            })}
          </div>

          {/* View More Button */}
          <motion.div
            variants={itemVariants}
            className="text-center mt-12"
          >
            <motion.a
              href="https://github.com"
              target="_blank"
              rel="noopener noreferrer"
              whileHover={{ scale: 1.05, y: -2 }}
              whileTap={{ scale: 0.95 }}
              className="inline-flex items-center space-x-2 px-8 py-4 bg-accent-500 hover:bg-accent-600 text-white rounded-full font-semibold transition-all duration-300"
            >
              <Github size={20} />
              <span>View More on GitHub</span>
            </motion.a>
          </motion.div>
        </motion.div>
      </div>
    </section>
  );
};

export default Projects;
